
function validateEmail(a){var b=/^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;return b.test(a)}function validatePassword(a){return(/^(?=.*\d)(?=.*[\u0021-\u002b\u003c-\u0040\u002c\u002e\u002d\u005f])(?=.*[A-Z])(?=.*[a-z])\S{8,12}$/.test(a))};